import React from 'react';
import { Routes, Route } from 'react-router-dom';  // Make sure this is imported

const App = () => {
  return (
    <div>
      <Routes>  {/* Only define routes here */}
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
      </Routes>
    </div>
  );
};

export default App;
